import React, { PureComponent } from 'react';

import "./Title.css"

export default class TitleCompent extends PureComponent {
    constructor(props) {
        super(props);
        this.state = {
			data:['博物馆智慧运营指挥中心','文物监管','楼宇运行','场馆服务','观众画像','口碑舆情','应急指挥']
        };
    }
    
    render() {
        return (
            <div>{this.state.data}</div>
        );
    }
}
